import './App.css';
import React, { useEffect, useState } from 'react';
import data from './components/data';
import Card from './components/Card';

function App() {
  const [tour, setTour] = useState(data);
  // const removeTour = (id) => {
  //   const newTour = tour.filter((tour) => tour.id !== id)
  //   setTour(newTour);
  // } 
  useEffect(()=> {
    if(tour.length === 0) {
      return(
       <div>
         <h2>No data found</h2>
         <button onClick={() => setTour()}>Refresh</button>
       </div>
      )
     }
  })

  return (
    <div className="App">
      <h3>Tour Project</h3>
      <Card tour={tour} setTour={setTour} />
    </div>
  );
}

export default App;
